INSERT INTO `content_i18n` VALUES (1,'<p>MONICET &eacute; um projecto de investiga&ccedil;&atilde;o destinado a estabelecer as metodologias e a criar a infraestrutura necess&aacute;ria para a constru&ccedil;&atilde;o de uma base de dados a longo prazo das observa&ccedil;&otilde;es de cet&aacute;ceos feitas pelos operadores comerciais nos A&ccedil;ores. &Eacute; baseado num cons&oacute;rcio de 3 companhias e um centro de investiga&ccedil;&atilde;o universit&aacute;rio, apoiado pelo Governo dos A&ccedil;ores.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Objectivos:</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Desenvolvimento de <strong>metodologia padr&atilde;o para a recolha de dados de avistamentos no mar</strong> a partir das embarca&ccedil;&otilde;es, que seja simples de usar nas condi&ccedil;&otilde;es de  opera&ccedil;&atilde;o comercial mas maximize o valor cient&iacute;fico dos dados recolhidos,  nomeadamente permitindo a quantifica&ccedil;&atilde;o do esfor&ccedil;o de observa&ccedil;&atilde;o.</li>\r\n<li>Desenvolvimento de <strong>metodologia padr&atilde;o para a recolha de dados dos avistamentos de terra</strong>, a partir das vigias, com os requisitos anteriores, incluindo a georeferencia&ccedil;&atilde;o dos avistamentos.</li>\r\n<li>Cria&ccedil;&atilde;o de <strong>uma base de dados da informa&ccedil;&atilde;o recolhida</strong> pelas empresas do cons&oacute;rcio nos avistamentos no mar e a partir de terra.</li>\r\n<li>Cria&ccedil;&atilde;o de um <strong>s&iacute;tio na internet</strong>, com liga&ccedil;&atilde;o din&acirc;mica &agrave;s base de  dados dos avistamentos, para introdu&ccedil;&atilde;o e consulta dos dados pelos  participantes no cons&oacute;rcio e para informa&ccedil;&atilde;o ao p&uacute;blico em geral.</li>\r\n</ul>','pt'),(1,'<p>MONICET is a research project aimed at developing the methodologies and the infrastucture to build a long term database of cetacean sightings from commercial operations in the Azores. It is based on a consortium of 3 companies and one research center, and supported by the Azores Government.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Objectives:</strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Development of a <strong>standard methodology for data collection at sea</strong>,   from the whale-watching vessels, that will be simple to apply in the   normal commercial operation conditions but also maximizes the scientific   value of the data collected, namely by allowing the quantification of   the observation effort.</li>\r\n<li>Development of a <strong>standard methodology for data collection from the whale-watching lookouts</strong>, with the same requisites as above, including the geographic location of the sightings.</li>\r\n<li>Creation of a <strong>database of the sightings</strong> information collected by the companies from both land and sea observations.</li>\r\n<li>Developement of a <strong>website</strong> with dynamic links to the database, to  allow data entering and  retrieval by the consortium members and for  general public information.</li>\r\n</ul>','en'),(2,'<p>Os cet&aacute;ceos s&atilde;o predadores de topo e, como tal, elementos chave do ambiente oce&acirc;nico. Sabe-se tamb&eacute;m que s&atilde;o animais altamente desenvolvidos, vivendo em sociedades complexas e exibindo um leque muito alargado de comportamentos. Apesar da sua import&acirc;ncia para o equil&iacute;brio ecol&oacute;gico da vida no mar, os cet&aacute;ceos t&ecirc;m uma longa hist&oacute;ria de sobre-explora&ccedil;&atilde;o e de competi&ccedil;&atilde;o com as actividades pesqueiras, as quais levaram &agrave; actual preocupa&ccedil;&atilde;o generalizada com a respectiva conserva&ccedil;&atilde;o. Por&eacute;m, s&oacute; para algumas esp&eacute;cies s&atilde;o conhecidos os factos mais b&aacute;sicos da respectiva biologia ou ecologia. Para a grande maioria das esp&eacute;cies de baleias e golfinhos n&atilde;o sabemos quantos s&atilde;o (nem quantos foram), como s&atilde;o construu&iacute;das as suas sociedades, de que se alimentam, de onde v&ecirc;m e para onde v&atilde;o.</p>\r\n<p>&nbsp;</p>\r\n<p>A import&acirc;ncia ecol&oacute;gica dos cet&aacute;ceos, e a atrac&ccedil;&atilde;o que muitas pessoas sentem pela sua elevada intelig&ecirc;ncia, combinaram-se para lhes proporcionar algum grau de protec&ccedil;&atilde;o legal e, ao mesmo tempo, estimularam o crescimento de um ramo da ind&uacute;stria tur&iacute;stica dedicado apenas &agrave; observa&ccedil;&atilde;o destes animais no estado selvagem. As actividades de observa&ccedil;&atilde;o de cet&aacute;ceos continuam a crescer em termos mundiais e s&atilde;o uma fonte importante de divisas na economia a&ccedil;oriana. A actividade nos A&ccedil;ores &eacute; regulamentada legalmente, e n&atilde;o existem indica&ccedil;&otilde;es de que afecte de forma significativa o bem-estar dos animais. Contudo n&atilde;o se conhecem para nenhuma esp&eacute;cie par&acirc;metros essenciais como o efectivo populacional, a distribui&ccedil;&atilde;o geogr&aacute;fica, as vias migrat&oacute;rias e o estatuto de conserva&ccedil;&atilde;o. &Eacute; importante medir estas vari&aacute;veis para poder mostrar que a ind&uacute;stria a&ccedil;oriana &eacute; sustent&aacute;vel e est&aacute; a ser orientada por padr&otilde;es de qualidade elevados. Isto &eacute; t&atilde;o importante para a percep&ccedil;&atilde;o p&uacute;blica da actividade como para a conserva&ccedil;&atilde;o das esp&eacute;cies.</p>\r\n<p>&nbsp;</p>\r\n<p>Os bi&oacute;logos que muitas vezes trabalham como timoneiros ou guias nas embarca&ccedil;&otilde;es de observa&ccedil;&atilde;o de cet&aacute;ceos devem ter um papel fulcral neste processo. Eles s&atilde;o as pessoas ideais para recolher os dados e assegurar que eles s&atilde;o arquivados de forma correcta. Algum deste trabalho pode ser efectuado durante a &eacute;poca alta, mas poderia ser poss&iacute;vel empregar algumas pessoas para o fazer durante os meses de inverno. Idealmente, estes dados ser&atilde;o a base de projectos cientificamente v&aacute;lidos, ajudando estes bi&oacute;logos a desenvolver carreiras de investiga&ccedil;&atilde;o inseridos na ind&uacute;stria e providenciando-lhes uma carreira mais compensadora.</p>\r\n<p>&nbsp;</p>\r\n<p>Neste contexto, um grupo das principais empresas dos A&ccedil;ores decidiu estabelecer um cons&oacute;rcio com o fim de desenvolver protocolos para recolha de dados que sejam cientificamente v&aacute;lidos mas sejam consistentes com os constrangimentos da opera&ccedil;&atilde;o comercial. A informa&ccedil;&atilde;o ser&aacute; armazenada em bases de dados a desenvolver igualmente durante este projecto, que ser&atilde;o f&aacute;ceis de gerir mas ao mesmo tempo suficientemente poderosas para armazenar as s&eacute;ries temporais necess&aacute;rias &agrave; actividade empresarial, &agrave; maximiza&ccedil;&atilde;o da experi&ecirc;ncia dos clientes, &agrave; monitoriza&ccedil;&atilde;o do ambiente marinho e &agrave; promo&ccedil;&atilde;o da reputa&ccedil;&atilde;o dos A&ccedil;ores como um destino tur&iacute;stico de primeira qualidade para a observa&ccedil;&atilde;o de cet&aacute;ceos.</p>','pt'),(2,'<p>Cetaceans are top predators and, as such, a key element of the ocean environment. They have also been shown to be highly developed animals, living in complex societies and exhibiting a wide range of behaviours. In spite of their importance for the ecological balance of life in the sea, they have a long history of direct over-exploitation and competition with human fishing activities which have resulted in the present heightened conservation concerns. To make matters worse, only for a handful of species are the basic facts of biology and ecology known in any detail. For the large majority of the species of whales and dolphins we do not know how many there are (nor how many there were), how are their societies build, what do they feed on, where do they come from, where do they go.</p>\r\n<p>&nbsp;</p>\r\n<p>The ecological importance of cetaceans, and the attraction that many people feel for their high intelligence, have combined to provide these animals with some degree of legal protection and, at the same time, have stimulated the growth of a branch of the tourist industry dedicated solely to their observation in the wild. Whale and dolphin watching activities are growing world-wide and are a major source of income for the Azorean economy. Whale watching in the Azores is regulated and there are no indications that at its current level it is having any biologically significant effect on the well-being of the cetacean populations that it targets. However, such key parameters as the size, geographical distribution, migratory routes and status remain unknown for any species. It is important to measure these variables to be able to show that the Azorean industry is truly sustainable and being conducted to the highest possible standards. This is as important for the public perception and the image of the activity as it is for biological management.</p>\r\n<p>&nbsp;</p>\r\n<p>The biologists that often work as second skippers and guides on Azorean whale watching vessels should have a key role in this process. They are the ideal people to collect the initial data and ensure that it is stored and archived correctly. Some of this could be done during the season, but it should also be possible to employ them to carry out this work in the winter months. Ideally, these data will generate worthwhile scientific projects for the biologists and help them to develop research careers within the industry, potentially providing a more fulfilling career path for these key workers within the whale watching industry.</p>\r\n<p>&nbsp;</p>\r\n<p>In this context, a group of the leading Azorean companies have decided to join hands to develop protocols for data collection which will provide the necessary data while remaining consistent with the constraints and requirements of the whale watching activities. The collected information will be stored in custom-built databases, easy to manage but powerful enough to hold the long term data series required for the industry needs, for monitoring the marine environment, to maximise the quality of the client&rsquo;s experience, and to promote the reputation of the Azores as a premier whale watching location.</p>','en'),(3,'<p>Projecto MONICET</p>\r\n<p>a/c Prof. Ana Isabel Neto</p>\r\n<p>&nbsp;</p>\r\n<p>CIRN, Universidade dos A&ccedil;ores</p>\r\n<p>R. M&atilde;e de Deus, 13A</p>\r\n<p>9501-801 Ponta Delgada</p>\r\n<p>A&ccedil;ores, Portugal</p>\r\n<p>&nbsp;</p>\r\n<p>Tel: + 351 296 650 102</p>\r\n<p>Fax: + 351 296 650 100</p>\r\n<div id=\"_mcePaste\" class=\"mcePaste\" style=\"position: absolute; left: -10000px; top: 138px; width: 1px; height: 1px; overflow: hidden;\">Tel: + 351 296 650 102</div>','pt'),(3,'<p>MONICET project</p>\r\n<p>c/o Prof. Ana Isabel Neto</p>\r\n<p>&nbsp;</p>\r\n<p>CIRN, Universidade dos A&ccedil;ores</p>\r\n<p>R. M&atilde;e de Deus, 13A</p>\r\n<p>9501-801 Ponta Delgada</p>\r\n<p>Azores, Portugal</p>\r\n<p>&nbsp;</p>\r\n<p>Phone: + 351 296 650 102</p>\r\n<p>Fax: + 351 296 650 100</p>','en');
