CREATE TABLE `general_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(45) NOT NULL,
  `vessel_id` int(11) DEFAULT NULL,
  `skipper_id` int(11) DEFAULT NULL,
  `guide_id` int(11) DEFAULT NULL,
  `company_id` int(11) NOT NULL,
  `base_latitude` varchar(45) NOT NULL,
  `base_longitude` varchar(45) NOT NULL,
  `date` date NOT NULL,
  `valid` tinyint(4) NOT NULL,
  `comments` text,
  `created_by` int(11) NOT NULL,
  `updated_by` int(11) NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `general_info_FI_1` (`vessel_id`),
  KEY `general_info_FI_2` (`skipper_id`),
  KEY `general_info_FI_3` (`guide_id`),
  KEY `general_info_FI_4` (`company_id`),
  KEY `general_info_FI_5` (`created_by`),
  KEY `general_info_FI_6` (`updated_by`)
) ENGINE=MyISAM AUTO_INCREMENT=589 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

